def predict(triples: list[Triple]) -> str:
    sentence = ""
    airport = None
    city = None
    country = None

    for triple in triples:
        if triple.predicate == "cityServed":
            city = triple.object
            airport = triple.subject
        elif triple.predicate == "country":
            country = triple.object
        elif triple.predicate == "elevationAboveTheSeaLevel":
            sentence += f"{airport} has an elevation of {triple.object} meters. "
        elif triple.predicate == "location":
            sentence += f"{airport} is located in {triple.object}. "
        elif triple.predicate == "runwayLength":
            sentence += f"Its runway length is {triple.object} meters. "
        elif triple.predicate == "1stRunwayLengthFeet":
            sentence += f"The first runway length is {triple.object} feet. "
        elif triple.predicate == "iataLocationIdentifier":
            sentence += f"The IATA identifier is {triple.object}. "
        elif triple.predicate == "nativeName":
            sentence += f"It is also known as {triple.object}. "
        elif triple.predicate == "capital":
            sentence += f"The capital of {triple.subject} is {triple.object}. "
        elif triple.predicate == "officialLanguage":
            sentence += f"The official language is {triple.object}. "
        elif triple.predicate == "largestCity":
            sentence += f"The largest city is {triple.object}. "

    if airport and city and country:
        sentence = f"{airport} serves the city of {city}, which is located in {country}. " + sentence
    elif airport and city:
        sentence = f"{airport} serves the city of {city}. " + sentence
    elif airport and country:
        sentence = f"{airport} is located in {country}. " + sentence
    elif airport:
        sentence = f"{airport} is an airport. " + sentence
    else:
        sentence = "Information unavailable."

    return sentence

